import React from 'react';
import { FaHome, FaUser, FaMoneyBill, FaIndent, FaSignOutAlt, FaUsers, FaCartPlus, FaDollarSign, FaChartLine } from 'react-icons/fa';

const Sidebar = ({ perfil }) => {
  // Function to render menu items based on user profile
  const renderMenuItems = () => {
    const menuItems = [];

    if (perfil === 'Administrador') {
      menuItems.push(
        <li key="inicio" className="active">
          <a href="inicio">
            <FaHome />
            <span>Inicio</span>
          </a>
        </li>,
        <li key="usuarios">
          <a href="usuarios">
            <FaUser />
            <span>Usuarios</span>
          </a>
        </li>
      );
    }

    if (perfil === 'Administrador' || perfil === 'Especial') {
      menuItems.push(
        <li key="categorias">
          <a href="categorias">
            <FaMoneyBill />
            <span>Tarifas</span>
          </a>
        </li>,
        <li key="productos">
          <a href="productos">
            <FaIndent />
            <span>Ingresos</span>
          </a>
        </li>,
        <li key="salidas">
          <a href="salidas">
            <FaSignOutAlt />
            <span>Salidas</span>
          </a>
        </li>
      );
    }

    if (perfil === 'Administrador' || perfil === 'Vendedor') {
      menuItems.push(
        <li key="clientes">
          <a href="clientes">
            <FaUsers />
            <span>Abonados</span>
          </a>
        </li>,
        <li key="cajas">
          <a href="cajas">
            <FaCartPlus />
            <span>Caja</span>
          </a>
        </li>,
        <li key="crear-venta">
          <a href="crear-venta">
            <FaDollarSign />
            <span>Pagos</span>
          </a>
        </li>
      );

      if (perfil === 'Administrador') {
        menuItems.push(
          <li key="reportes">
            <a href="reportes">
              <FaChartLine />
              <span>Reporte de ventas</span>
            </a>
          </li>
        );
      }
    }

    return menuItems;
  };

  return (
    <aside className="main-sidebar" style={{ position: 'absolute', top: 0, left: 0, width: '232px', paddingTop: '78px', minHeight: '100%', backgroundColor: '#000000', borderRight: '2px solid #e3aa00' }}>
      <section className="sidebar">
        <ul className="sidebar-menu">
          {renderMenuItems()}
        </ul>
      </section>
    </aside>
  );
};

export default Sidebar;
